import React from "react";
///import vaidhya_header_img from "..images/vaidhya_header_img.jpg"
import vaidhyalogo from "../images/vaidhya_header_img.jpg"
function Header(){
    return(
        <nav>
              <img
                src={vaidhyalogo} width= "100px"
                />
                <ul>
                    <li>About</li>
                    <li>ContactUs</li>
                    <li>Services</li>
                    <li>Login</li>

                </ul>
            </nav>
    )
}
export default Header
